const Borrow = () => {

  return (
    <>
      <h1>ログインページ</h1>
      <div>
        新規登録は<Link to={`/register/`}>こちら</Link>
      </div>
      <div>
        <Link to={`../home6`}>ホームに戻る</Link>
      </div>
    </>
  );
};

export default Borrow;
